import React from 'react';
import axios from 'axios';
import { Container, DropdownButton, Dropdown, Navbar } from "react-bootstrap";
import './Menu.css';

class Menu extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            brands: [{

            }]
        }
    }



    render() {
        return(
            <div>
                <Navbar>
                    <Container>
                        <DropdownButton id="dropdown-basic-button" title="Brand">
                            {

                            }
                            <Dropdown.Item href="#/action-1">Samsung</Dropdown.Item>
                            <Dropdown.Item href="#/action-2">iPhone</Dropdown.Item>
                        </DropdownButton>
                    </Container>
                </Navbar>
            </div>
        );
    }
}

export default Menu;
